package cracking.code.fb;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Objects;
import java.util.Queue;
import java.util.Set;

public class SlidingWindow {

	public static void main(String[] args) {
		int[] a = new int[] { -2, 1, -3, 4, -1, 2, 1, -5, 4 };
		System.out.println(findSumMaxSubarrayForContinousArray(a));
		System.out.println(findSumMaxSubarrayOfSizeK(a, 3));
		int[] b = new int[] { 10, -1, -5, 7, -15, 20, 18, 24 };
		findFirstNegativeNumberInSubarrayOfSizeK(b, 3);
		System.out.println(countOccurrenceOfAnagram("forxxorfxdofr", "for"));
		findAnagrams(
				"",
				"");
		isAnagram("anagram", "nagaram");
		
		List<Integer> a1 = new ArrayList<>();
		a1.add(1);
		a1.add(1);
		a1.add(1);
		a1.add(1);
		List<Integer> b1= new ArrayList<>();
		b1.add(1);
		b1.add(1);
		b1.add(1);
		isValidSubsequence(a1, b1);	
	}
	
	public static boolean isValidSubsequence(List<Integer> array, List<Integer> sequence) {
		HashMap<Integer, Integer> hm = new HashMap<>();
		for (int i = 0; i < array.size(); i++) {
			hm.put(array.get(i), hm.getOrDefault(array.get(i), 0) + 1);
		}
		for (int j = 0; j < sequence.size(); j++) {
			if (!hm.containsKey(sequence.get(j))) {
				return false;
			}else{
				if(hm.get(sequence.get(j)) <= 0) {
					return false;
				}else {
					hm.put(sequence.get(j), hm.get(sequence.get(j)) -1);
				}
			}
		}
		return true;
	}

	private static int findSumMaxSubarrayForContinousArray(int[] a) {
		if (a.length == 0) {
			return 0;
		}
		// 1 2 3 4 5 6
		int max = Integer.MIN_VALUE;
		int current = a[0];
		for (int i = 1; i < a.length; i++) {
			if (current >= 0) {
				current += a[i];
			} else {
				current = a[i];
			}
			max = Math.max(max, current);
		}
		return max;
	}

	private static int findSumMaxSubarrayOfSizeK(int[] a, int k) {
		if (k == 0 || a.length == 0) {
			return 0;
		}
		// 1 2 3 4 5 6
		int len = a.length;
		int max = Integer.MIN_VALUE;
		int windowStart = 0;
		int windowSum = 0;
		for (int windowEnd = 0; windowEnd < len; windowEnd++) {
			windowSum += a[windowEnd];
			if (windowEnd - windowStart + 1 == k) {
				max = Math.max(max, windowSum);
				windowSum -= a[windowStart];
				windowStart++;
			}
		}
		return max;
	}

	/*
	 * 10, -1, -5, 7, -15, 20, 18, 24
	 * 
	 */
	private static int[] findFirstNegativeNumberInSubarrayOfSizeK(int[] a, int k) {
		int len = a.length;
		int[] res = new int[len - k + 2];

		int windowStart = 0;
		Queue<Integer> queue = new LinkedList<Integer>();
		int resIdx = 0;
		for (int windowEnd = 0; windowEnd < a.length; windowEnd++) {
			if (a[windowEnd] < 0) {
				queue.add(a[windowEnd]);
			}
			if (windowEnd - windowStart + 1 == k) {
				if (queue.isEmpty()) {
					res[resIdx++] = 0;
				} else {
					int num = queue.peek();
					res[resIdx++] = num;

					if (num == a[windowStart]) {
						queue.remove();
					}
				}
				windowStart++;
			}
		}
		System.out.println(Arrays.toString(res));
		return res;
	}

	private static boolean isAnagram(Map<Character, Integer> wordCount, Map<Character, Integer> substrCount) {
		Set<Character> keySet = wordCount.keySet();
		for (char c : keySet) {
			if (!Objects.equals(wordCount.get(c), substrCount.get(c))) {
				return false;
			}
		}
		return true;
	}

	public static List<Integer> findAnagrams(String s, String p) {

		if (p.length() > s.length()) {
			return new ArrayList<>();
		}

		int n = s.length();
		int k = p.length();
		List<Integer> res = new ArrayList<Integer>();

		Map<Character, Integer> wordCount = new HashMap<Character, Integer>();
		for (int i = 0; i < k; i++) {
			char c = p.charAt(i);
			wordCount.put(c, wordCount.getOrDefault(c, 0) + 1);
		}
		Map<Character, Integer> substrCount = new HashMap<>();
		int windowStart = 0;
		for (int windowEnd = 0; windowEnd < n; windowEnd++) {
			char c = s.charAt(windowEnd);
			substrCount.put(c, substrCount.getOrDefault(c, 0) + 1);
			if (windowEnd - windowStart + 1 == k) {
				if (isAnagram(wordCount, substrCount)) {
					res.add(windowEnd - k + 1);
				}
				substrCount.put(s.charAt(windowStart), substrCount.get(s.charAt(windowStart)) - 1);
				windowStart++;
			}
		}
		System.out.println(res);
		return res;
	}

	private static int countOccurrenceOfAnagram(String text, String word) {
		int n = text.length();
		int k = word.length();
		int count = 0;

		Map<Character, Integer> wordCount = new HashMap<Character, Integer>();
		for (int i = 0; i < k; i++) {
			char c = word.charAt(i);
			wordCount.put(c, wordCount.getOrDefault(c, 0) + 1);
		}

		Map<Character, Integer> substrCount = new HashMap<>();
		int windowStart = 0;
		for (int windowEnd = 0; windowEnd < n; windowEnd++) {
			char c = text.charAt(windowEnd);
			substrCount.put(c, substrCount.getOrDefault(c, 0) + 1);
			if (windowEnd - windowStart + 1 == k) {
				if (isAnagram(wordCount, substrCount)) {
					count++;
				}
				substrCount.put(text.charAt(windowStart), substrCount.get(text.charAt(windowStart)) - 1);
				windowStart++;
			}
		}
		return count;
	}

	public static boolean isAnagram(String s, String t) {
		if (s.length() != t.length())
			return false;
		Map<Character, Integer> map = new HashMap<>();
		for (Character c : s.toCharArray()) {
			map.put(c, map.getOrDefault(c, 0) + 1);
		}
		for (Character c : t.toCharArray()) {
			Integer val = map.get(c);
			if (null != val && (val - 1) != 0) {
				map.put(c, val - 1);
			} else {
				map.remove(c);
			}
		}
		return map.isEmpty();
	}
}
